def get_service(filename):
    count = 0
    china_ipv6_total_dict = {}
    f = open(filename, "r")
    for line in f:
        if line[0] != "#":

            if "Ports" in line:
                count = count + 1
                port_dict = {}
                port = line[line.find("Ports") + 6:]
                #print(port)
                i = port.count(",")
                #print(i)
                #print(count)
                for num in range(0, i + 1):
                    if "//" in port.split(",")[num]:
                        port_dict[port.split(",")[num].split("/")[0][1:]] = port.split(",")[num].split("//")[1]
                china_ipv6_total_dict[line[6:line.find("(")-1]] = port_dict
    #print(china_ipv6_total_dict)
    f.close()

    values = china_ipv6_total_dict.values()
    #print(china_ipv6_total_dict.items())
    service_dict = {}
    for element in values:
        #for service in element.values():
        for service in element.items():
            if service not in service_dict.keys():
                service_dict[service] = 1
            else:
                service_dict[service] += 1
    g = open("service.txt", "a")
    g.writelines("#" + filename + "\n")
    g.writelines(str(count) + "\n")
    g.writelines(str(service_dict) + "\n")
    g.writelines(str(sorted(service_dict.items(), key=lambda item:item[1])) + "\n")
    g.close()
    print(count)
    print(service_dict)
    print(sorted(service_dict.items(), key=lambda item:item[1]))

def get_service_serve(filename):
    serve_dict = {}
    f = open(filename, "r")
    for line in f:
        if "#" not in line:
            if "Ports" in line:
                port = line[line.find("Ports") + 7:]
                port_list = port.split(", ")
                port_list[-1] = port_list[-1].split("\t")[0]
                print(port_list)
                for element in port_list:
                    if "///" not in element:
                        if element.split("/")[0] not in serve_dict.keys():
                            serve_dict[element.split("/")[0]] = {}
                            serve_dict[element.split("/")[0]][element.split("//")[-1][:-1]] = 1
                        else:
                            if element.split("//")[-1][:-1] not in serve_dict[element.split("/")[0]].keys():
                                serve_dict[element.split("/")[0]][element.split("//")[-1][:-1]] = 1
                            else:
                                serve_dict[element.split("/")[0]][element.split("//")[-1][:-1]] += 1
    print(serve_dict)
    f.close()
    g = open("china_1000000_serve.txt", "w")
    g.writelines(str(serve_dict))
    g.close()

def get_whois(filename):
    g = open("china_AS.txt", "a")
    f = open(filename, "r", encoding='gb18030', errors='ignore')
    whois_dict = {}
    # line_count = 0
    for line in f:
        # line_count += 1
        # print(line_count)
        if line[0] == "%":
            continue
        count = 0
        if line[0] == "#":
            count += 1
            if count == 1 and whois_dict != {}:
                # print(str(whois_dict))
                g.writelines(str(whois_dict) + "\n")
            whois_dict = {}
            continue
        blank_count = 0
        pre_i = "n"
        for i in line:
            if pre_i == " " and i != " ":
                break
            if i == " ":
                blank_count += 1
            pre_i = i
        # if not whois_dict.has_key(line.split(" ")[0][:line.find(":")]):
        if line.split(" ")[0][:line.find(":")] not in whois_dict.keys():
            whois_dict[line.split(" ")[0][:line.find(":")]] = line[line.find(":") + blank_count + 1:-1]
    f.close()
    g.close()

